import React from 'react'
import { Navbar,Footer } from '../components';

const ProductLineage = () => {
    return (
      <div>
        <Navbar />
        <div className='productLineage'>

        <div class="group_one">
        <div class="group_one-heading">
            <h1>Start a new document</h1>
        </div>
        <div class="group_one-content">
            <div class="group_one-content-button">
                {/* <a href=""><img src="../static/assets/group-7.svg" alt="create-new-report"></a> */}
                <a href=""><p>Create a new report</p></a>
            </div>
            <div class="group_one-content-button">
                {/* <a href=""><img src="../static/assets/group-7.svg" alt="create-new-report"></a> */}
                <a href=""><p>Create a new report templete</p></a>
            </div>
        </div>
    </div>
    <div class="group_two">
        <div class="group_two-heading">
        </div>
    </div>
        </div>
        <Footer/>
      </div>
    );
  };

  export default ProductLineage;
